你是一个专门的文件分析代理。你的任务是深入分析当前指定的文件并提供详细的、有证据支持的分析结果。请专注于当前焦点文件或当前特定任务。当你认为你的分析已完成或无法进一步推进时，继续下一个任务或结束任务。

**工作原则：**
-   **基于证据**：所有分析都必须基于从工具获取的实际证据；禁止无根据的猜测。
-   **结果验证**：批判性地评估委托子任务（例如函数分析）返回的结果，并始终验证其真实性和可靠性，以防止虚假结果污染最终结论。

**工作流程：**
1.  **理解任务**：专注于当前分析文件的特定任务，并充分参考用户的整体要求。注意，如果任务与当前分析焦点不匹配，你需要停止分析并及时向用户反馈。不要执行跨目录分析。
2.  **执行分析**：确保你的分析有足够的深度。对于复杂任务，将其分解为多个具有明确目标和步骤的子任务，并合理地按顺序或并行调用分析助手或工具。选择最合适的工具或助手来获取证据。对于复杂的调用链，使用 `FunctionAnalysisDelegator` 并提供详细的污点信息和上下文。谨慎使用某些工具，避免结果过长导致分析失败，例如 `strings` 工具。
3.  **完成并报告**：完成分析后，使用 `finish` 动作并严格按照以下格式提交最终报告。

**最终响应要求**：
*   回答与当前任务相关的所有问题，你的响应必须有完整的证据。不要遗漏任何有效信息。
*   用具体证据支持所有发现，并如实报告任何证据不足或困难。

每个发现必须包含以下**核心字段**：
- **`description`**：对发现的详细描述，必须包括：
* **完整且可验证的攻击链**：从攻击者可控源到危险汇聚点的具体污点传播路径，每一步都有证据支持。
* **精确的触发条件**：到达易受攻击代码路径所需的确切条件。
* **可利用性分析**：清楚说明*为什么*这是可利用的（例如，缺少清理、逻辑缺陷）。

- **`link_identifiers`**：特定的 NVRAM 或 ENV 变量名、文件路径、IPC 套接字路径和自定义共享函数符号。
- **`location`**：代码汇聚点或关键逻辑的精确位置。
- **`code_snippet`**：返回完整的相关代码片段，展示漏洞。
- **`risk_score`**：风险评分（0.0-10.0）。**只有具有经过验证的完整攻击链和明确安全影响的发现才能得分 >= 7.0。**
- **`confidence`**：对发现准确性和可利用性分析的置信度（0.0-10.0）。**得分 >= 8.0 需要从源到汇聚点的完整、可验证的攻击链。**
- **`notes`**：供人工分析师参考。包括：需要进一步验证的假设、相关文件或函数、后续分析的建议方向。

#### 关键原则：
- **可利用性是必须的**：只报告实际可利用的发现。理论上的弱点或不良实践（如使用 `strcpy`）是不够的，除非你能证明它们会导致漏洞。
- **需要完整路径**：部分或推测性路径（"如果...可能存在漏洞"）是不可接受的。你必须提供完整、经过验证的链。
- **证据优于推测**：所有声明都必须由工具的证据支持。如果缺少证据，请明确说明。不要猜测。

*   在 'action' 字段中选择工具或 'finish'，并在 'action_input' 中提供参数或最终响应。


当前可用工具：
- Name: get_context_info
  Description: 获取当前分析任务的上下文信息，例如正在分析的文件或目录。
  Parameters (JSON Schema format):
{
  "type": "object",
  "properties": {},
  "required": []
}

- Name: execute_shell
  Description: 在当前目录（lib）中执行只读 shell 命令。
    **警告：** 此工具严格限制在当前工作目录内。所有文件操作不得引用父目录或任何其他目录。建议使用 `file` 工具在当前目录内进行探索和识别。
    **注意：** 所有命令都在当前目录中执行。所有路径参数应相对于当前目录。禁止包含 '/' 或 '..' 的路径。
    支持的命令：file, find, strings, grep, head, tail, readelf, cat, sort, ls。
    禁止输出重定向（'>'、'>>'）、命令链接和目录更改。
  Parameters (JSON Schema format):
{
  "type": "object",
  "properties": {
    "command": {
      "type": "string",
      "description": "要执行的 shell 命令。命令将在 'lib' 目录中执行。命令中的所有路径应相对于此目录。"
    }
  },
  "required": [
    "command"
  ]
}

- Name: r2
  Description: 
    与 Radare2 交互式会话交互以分析当前二进制文件。注意，此工具会自动为当前分析焦点文件建立并维护 r2 会话。

    主要功能：
    - 发送 Radare2 命令并获取输出
    - 会话状态在调用之间保持（对于同一文件）
    - 支持使用 r2ghidra 插件进行反编译：
    * 使用 `pdg` 命令反编译函数
    * 提供类似 C 的伪代码输出


  Parameters (JSON Schema format):
{
  "type": "object",
  "properties": {
    "command": {
      "type": "string",
      "description": "Command to interact directly with Radare2"
    }
  },
  "required": [
    "command"
  ]
}

- Name: TaskDelegator
  Description: 助手可以与文件交互以执行特定的文件分析任务。使用场景：当你需要单步任务的分析结果后再决定下一个分析任务时。
  Parameters (JSON Schema format):
{
  "type": "object",
  "properties": {
    "task": {
      "type": "string",
      "description": "要执行的子任务的详细描述。请指定分析对象。"
    },
    "run_in_background": {
      "type": "boolean",
      "description": "是否在后台运行此任务。",
      "default": false
    }
  },
  "required": [
    "task"
  ]
}

- Name: ParallelTaskDelegator
  Description: 每个助手可以与文件交互，并行执行多个文件分析子任务。使用场景：1. 当复杂任务需要分解为多个独立的子任务时。2. 子任务之间没有严格的执行顺序依赖。3. 建议对大规模和复杂任务并行执行多个子任务，提高分析效率。
  Parameters (JSON Schema format):
{
  "type": "object",
  "properties": {
    "tasks": {
      "type": "array",
      "items": {
        "type": "string",
        "description": "要执行的子任务的详细描述。每个任务描述都是独立的，应指定分析对象。"
      },
      "description": "要分配给子代理并行执行的独立任务描述列表。"
    },
    "run_in_background": {
      "type": "boolean",
      "description": "是否在后台运行此任务。",
      "default": false
    }
  },
  "required": [
    "tasks"
  ]
}

**后台执行和任务调度**：
- 在 action_input 中设置 `run_in_background: true` 可异步运行任务。
- 后台任务完成时，结果会自动注入。
- 当需要后台结果才能继续时，使用 'wait' 动作。

调度策略（避免遗漏和重复，最大化效率）：
1. 识别独立任务，如果不立即需要结果，在后台启动它们。
2. 在后台任务并行运行时继续其他工作。
3. 当依赖任务需要后台结果时使用 'wait'。
4. 在脑海中跟踪所有启动的后台任务以避免重复。
5. 在 'finish' 之前，确保所有后台任务都已完成并整合结果。

响应格式要求：

你必须以严格的 JSON 格式响应。不要在 JSON 对象之外添加任何其他文本。
不要使用 markdown 格式（如 ```json）。直接输出单个 JSON 对象。

响应必须是符合以下模式的有效 JSON 对象：

{
  "type": "object",
  "properties": {
    "thought": {
      "type": "string",
      "description": "在这里逐步思考。分析当前情况、目标、可用工具和对话历史。决定是调用工具还是使用 'finish' 动作提供最终答案。"
    },
    "action": {
      "type": "string",
      "description": "选择下一个动作。必须是可用工具名称之一、'wait' 或 'finish'。"
    },
    "action_input": {
      "oneOf": [
        {
          "type": "object"
        },
        {
          "type": "string"
        }
      ],
      "description": "工具调用的参数或最终响应。如果 action 是工具名称，提供该工具所需的参数（通常是对象）；如果是 'finish'，使用 'final_response' 作为 action_input 的键提供最终响应（通常是包含字符串的对象）。"
    },
    "status": {
      "type": "string",
      "enum": [
        "continue",
        "complete"
      ],
      "description": "必须是 'continue'（如果选择了工具）或 'complete'（如果选择了 'finish'）。"
    }
  },
  "required": [
    "thought",
    "action",
    "action_input",
    "status"
  ]
}

{
  "thought": "首先，我需要了解当前分析任务的上下文，特别是关于 'acos_nat.ko' 文件的信息。然后，我将使用工具来获取文件的基本信息，并深入分析其内容以寻找可利用的漏洞。由于这是一个内核模块，我将重点关注输入点如 ioctl、系统调用等，并追踪数据流以识别完整的攻击链。",
  "action": "get_context_info",
  "action_input": {},
  "status": "continue"
}

{
  "thought": "现在我知道 'acos_nat.ko' 是一个内核模块文件，位于 'lib' 目录中。我需要深入分析这个文件以识别潜在的可利用漏洞。首先，我将使用 'execute_shell' 工具获取文件的基本信息，确认文件类型和属性。然后，使用 'r2' 工具加载文件并进行反编译分析，重点关注输入点（如 ioctl 处理函数）和数据流传播路径。目标是找到完整的攻击链，从不可信输入到危险操作。",
  "action": "execute_shell",
  "action_input": {
    "command": "file acos_nat.ko"
  },
  "status": "continue"
}

{
  "thought": "现在我知道 'acos_nat.ko' 是一个 ARM 32 位 ELF 可重定位文件，未剥离符号，这有助于分析。我将使用 r2 工具加载文件并分析其符号和函数，以识别潜在的输入点（如 ioctl 处理）和数据流。首先，我将使用 r2 命令来获取符号列表和反编译关键函数，寻找可利用的漏洞链。",
  "action": "r2",
  "action_input": {
    "command": "aaa; is"
  },
  "status": "continue"
}

{
  "thought": "我将开始分析 'acos_nat.ko' 文件，重点关注潜在的可利用漏洞。首先，我需要识别输入点，如 ioctl 处理函数和网络钩子函数。然后，追踪数据流以找到完整的攻击链。我将使用 r2 工具反编译关键函数，如 'agDoIoctl'，因为它可能处理用户空间 ioctl 请求，这是一个常见的输入点。此外，我将检查网络相关函数如 'acosNat_PreRouting' 和 'acosNat_PostRouting'，因为它们处理网络数据包。目标是找到从不可信输入到危险操作的完整路径。",
  "action": "r2",
  "action_input": {
    "command": "pdg @ 0x08026e0c"
  },
  "status": "continue"
}

